import React, { Component } from "react";
import IconButton from "@material-ui/core/IconButton";
import axios from "axios";
import IntlMessages from "../../../util/IntlMessages";
import ShowVirtualClass from "./ShowVirtualClass";
import baseUrl from "../../../config/config";
import _ from "lodash";
import { connect } from "react-redux";
import DeleteVirtualClass from "./DeleteVirtualClass";
import moment from "moment";
import { deleteClassVirtual } from "../../../actions/VirtualClassAction";
import Button from "@material-ui/core/Button";
import professor1 from "./Assets/prof1.jpg";
import professor2 from "./Assets/prof2.jpg";
import Switch from "@material-ui/core/Switch";
import { roleIdSuperAdmin } from "../../../config/config";
import { roleIdAdmin } from "../../../config/config";
import { roleIdProfessor } from "../../../config/config";
import { roleIdParent } from "../../../config/config";
import { roleIdStudent } from "../../../config/config";
import { roleIdSupervisor } from "../../../config/config";
import { roleIdDirector } from "../../../config/config";

class VitualClassListItems extends Component {
  constructor(props) {
    super(props);
    this.state = {
      menuState: false,
      itemId: 0,
      modifModal: false,
      deleteIsopen: false,
      anchorEl: undefined,
      ClassVirtualObject: {},
    };
    this.handleShow = this.handleShow.bind(this);
    this.cancelModal = this.cancelModal.bind(this);
    this.handleDeleteClassVirtual = this.handleDeleteClassVirtual.bind(this);
    this.handleShowDeleteModal = this.handleShowDeleteModal.bind(this);
  }
  handleShowDeleteModal = () => {
    this.setState({ menuState: false, deleteIsopen: true });
  };

  handleDeleteClassVirtual = () => {
    this.props.deleteClassVirtual(this.state.ClassVirtualObject.id);
    this.setState({ deleteIsopen: false });
  };

  cancelModal() {
    this.setState({ modifModal: false, deleteIsopen: false });
  }
  handleShow() {
    this.setState({
      modifModal: true,
      menuState: false,
    });
  }

  onOptionMenuSelect = (event) => {
    this.setState({
      menuState: true,
      anchorEl: event.currentTarget,
    });
  };
  handleRequestClose = () => {
    this.setState({ menuState: false });
  };
  componentDidUpdate(prevProps, prevState) {
    if (prevProps.classVirtualElement !== this.props.classVirtualElement) {
      var ClassObject = {};
      ClassObject.id = this.props.classVirtualElement.id;
      ClassObject.class_url = this.props.classVirtualElement.class_url;
      ClassObject.password = this.props.classVirtualElement.password;
      ClassObject.date_virtual_class = this.props.classVirtualElement.date_virtual_class;
      ClassObject.start_time_class = this.props.classVirtualElement.start_time_class;
      ClassObject.end_time_class = this.props.classVirtualElement.end_time_class;
      ClassObject.status = this.props.classVirtualElement.status;
      ClassObject.object = this.props.classVirtualElement.object;
      ClassObject.establishment_id = this.props.classVirtualElement.establishment_id;
      ClassObject.virtual_class_status = this.props.classVirtualElement.virtual_class_status;
      ClassObject.subject_id = this.props.classVirtualElement.subject_id;
      ClassObject.class_id = this.props.classVirtualElement.class_id;
      ClassObject.professor_id = this.props.classVirtualElement.professor_id;

      axios
        .get(
          `${baseUrl.baseUrl}/classes_professors?access_token=${localStorage.token}&filter[where][subject_id]=` +
            this.props.classVirtualElement.subject_id +
            `&filter[include][professor][profile][user]`
        )
        .then((res) => {
          ClassObject.ProfessorName =
            res.data[0].professor.profile.user.name +
            " " +
            res.data[0].professor.profile.user.surname;
          ClassObject.ProfessorNameAR =
            res.data[0].professor.profile.user.surname_ar +
            " " +
            res.data[0].professor.profile.user.name_ar;

          axios
            .get(
