            axios
              .get(
                `${baseUrl.baseUrl}/subjects/` +
                  this.props.classVirtualElement.subject_id +
                  `?access_token=${localStorage.token}`
              )
              .then((res) => {
                ClassObject.SubjectName_FR = res.data.name_FR;
